import request from '@/utils/request'

const baseUrl = `/log/cmn/county`

export default {
    getCountiesByParentId(parentId) {
        return request({
            url: `${baseUrl}/getCountiesByParentId/${parentId}`,
            method: 'get'
        })
    },

    getCountyById(id) {
        return request({
            url: `${baseUrl}/getCountyById/${id}`,
            method: 'get'
        })
    }
}
